CREATE TABLE IF NOT EXISTS gdp (
    `Goal` INT,
    `Target` NUMERIC(2, 1),
    `Indicator` VARCHAR(5) CHARACTER SET utf8,
    `SeriesCode` VARCHAR(11) CHARACTER SET utf8,
    `SeriesDescription` VARCHAR(45) CHARACTER SET utf8,
    `GeoAreaCode` INT,
    `GeoAreaName` VARCHAR(52) CHARACTER SET utf8,
    `TimePeriod` INT,
    `Value` NUMERIC(5, 2),
    `Time_Detail` INT,
    `UpperBound` INT,
    `LowerBound` INT,
    `BasePeriod` INT,
    `Source` VARCHAR(84) CHARACTER SET utf8,
    `FootNote` INT,
    `Nature` VARCHAR(2) CHARACTER SET utf8,
    `Units` VARCHAR(7) CHARACTER SET utf8,
    `Reporting_Type` VARCHAR(1) CHARACTER SET utf8
);
